import React from 'react';
import { ArrowLeft, Calendar, MapPin, DollarSign, ExternalLink, Download, Share2, Sparkles } from 'lucide-react';
import { TripPlan, TripResultProps } from '../types';

const TripResult: React.FC<TripResultProps> = ({ tripPlan, onReset }): JSX.Element => {
  // ÏùºÏ†ïÌëúÎ•º Î†åÎçîÎßÅÌïòÎäî Ìï®Ïàò
  const renderSchedule = (day: any) => {
    return (
      <div key={day.day} className="itinerary-day">
        <div className="day-header">
          <span className="day-badge">
            {day.day}ÏùºÏ∞®
          </span>
          <span className="day-date">{day.date}</span>
        </div>
        
        <div className="day-schedule">
          <div className="schedule-item morning">
            <h4 className="schedule-title morning">üåÖ Ïò§Ï†Ñ</h4>
            <p className="schedule-content morning">{day.morning}</p>
          </div>
          <div className="schedule-item afternoon">
            <h4 className="schedule-title afternoon">‚òÄÔ∏è Ïò§ÌõÑ</h4>
            <p className="schedule-content afternoon">{day.afternoon}</p>
          </div>
          <div className="schedule-item evening">
            <h4 className="schedule-title evening">üåô Ï†ÄÎÖÅ</h4>
            <p className="schedule-content evening">{day.evening}</p>
          </div>
        </div>
        
        <div className="schedule-item accommodation">
          <h4 className="schedule-title accommodation">üè® ÏàôÎ∞ï</h4>
          <p className="schedule-content accommodation">{day.accommodation}</p>
        </div>
      </div>
    );
  };

  const handleDownload = (): void => {
    const content = `
      Ïó¨Ìñâ Í≥ÑÌöçÏÑú

      Î™©Ï†ÅÏßÄ: ${tripPlan.destination}
      Í∏∞Í∞Ñ: ${tripPlan.duration}
      Ï¥ù ÎπÑÏö©: ${tripPlan.total_cost}

      ÏùºÏ†ï:
      ${tripPlan.itinerary.map(day => `
      ${day.day}ÏùºÏ∞® (${day.date})
      Ïò§Ï†Ñ: ${day.morning}
      Ïò§ÌõÑ: ${day.afternoon}
      Ï†ÄÎÖÅ: ${day.evening}
      ÏàôÎ∞ï: ${day.accommodation}
      `).join('')}

      

      Ïó¨Ìñâ ÌåÅ:
      ${tripPlan.tips.map(tip => `‚Ä¢ ${tip}`).join('\n')}
    `;
    
    const blob = new Blob([content], { type: 'text/plain' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = `${tripPlan.destination}_Ïó¨ÌñâÍ≥ÑÌöçÏÑú.txt`;
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
  };

  const handleShare = async (): Promise<void> => {
    if (navigator.share) {
      try {
        await navigator.share({
          title: `${tripPlan.destination} Ïó¨Ìñâ Í≥ÑÌöç`,
          text: `AIÍ∞Ä ÎßåÎì† ${tripPlan.destination} Ïó¨Ìñâ Í≥ÑÌöçÏùÑ ÌôïÏù∏Ìï¥Î≥¥ÏÑ∏Ïöî!`,
          url: window.location.href
        });
      } catch (error) {
        console.log('Í≥µÏú† Ï∑®ÏÜåÎê®');
      }
    } else {
      // Í≥µÏú† APIÍ∞Ä ÏßÄÏõêÎêòÏßÄ ÏïäÎäî Í≤ΩÏö∞ ÌÅ¥Î¶ΩÎ≥¥ÎìúÏóê Î≥µÏÇ¨
      const text = `${tripPlan.destination} Ïó¨Ìñâ Í≥ÑÌöç: ${window.location.href}`;
      navigator.clipboard.writeText(text);
      alert('ÎßÅÌÅ¨Í∞Ä ÌÅ¥Î¶ΩÎ≥¥ÎìúÏóê Î≥µÏÇ¨ÎêòÏóàÏäµÎãàÎã§!');
    }
  };

  return (
    <div className="result-container">
      {/* Ìó§Îçî */}
      <div className="result-header">
        <button
          onClick={onReset}
          className="back-button"
        >
          <ArrowLeft />
          <span>ÏÉàÎ°úÏö¥ Ïó¨Ìñâ Í≥ÑÌöç ÎßåÎì§Í∏∞</span>
        </button>
        
        <div className="action-buttons">
          <button onClick={handleDownload} className="action-button">
            <Download />
            <span>Îã§Ïö¥Î°úÎìú</span>
          </button>
          <button onClick={handleShare} className="action-button">
            <Share2 />
            <span>Í≥µÏú†</span>
          </button>
        </div>
      </div>

      {/* Ïó¨Ìñâ Í∞úÏöî */}
      <div className="overview-card">
        <div className="overview-header">
          <h1 className="overview-title">
            üéâ {tripPlan.destination} Ïó¨Ìñâ Í≥ÑÌöç ÏôÑÏÑ±!
          </h1>
          <p className="overview-subtitle">AIÍ∞Ä ÎãπÏã†ÏùÑ ÏúÑÌï¥ ÎßûÏ∂§Ìòï Ïó¨Ìñâ Í≥ÑÌöçÏùÑ ÎßåÎì§ÏóàÏäµÎãàÎã§</p>
        </div>
        
        <div className="overview-grid">
          <div className="overview-item blue">
            <MapPin className="overview-icon blue" />
            <h3 className="overview-label">Î™©Ï†ÅÏßÄ</h3>
            <p className="overview-value">{tripPlan.destination}</p>
          </div>
          <div className="overview-item green">
            <Calendar className="overview-icon green" />
            <h3 className="overview-label">Ïó¨Ìñâ Í∏∞Í∞Ñ</h3>
            <p className="overview-value">{tripPlan.duration}</p>
          </div>
          <div className="overview-item purple">
            <DollarSign className="overview-icon purple" />
            <span className="overview-label">ÏòàÏÉÅ ÎπÑÏö©</span>
            <p className="overview-value">{tripPlan.total_cost}</p>
          </div>

        </div>
      </div>

      {/* ÏÉÅÏÑ∏ ÏùºÏ†ï */}
      <div className="itinerary-card">
        <h2 className="itinerary-title">üìÖ ÏÉÅÏÑ∏ ÏùºÏ†ï</h2>
        <div className="itinerary-list">
          {tripPlan.itinerary.map((day, index) => renderSchedule(day))}
        </div>
      </div>

      {/* ÎåÄÏ§ëÍµêÌÜµ Ï†ïÎ≥¥ */}
      {tripPlan.transport_info && (
        <div className="transport-card">
          <h2 className="transport-title">üöå ÎåÄÏ§ëÍµêÌÜµ Ï†ïÎ≥¥</h2>
          <div className="transport-list">
            {Object.entries(tripPlan.transport_info.itinerary_transport || {}).map(([dayKey, dayTransport]) => {
              const dayNumber = dayKey.replace('day_', '');
              return (
                <div key={dayKey} className="transport-day">
                  <h3 className="transport-day-title">{dayNumber}ÏùºÏ∞® Ïù¥Îèô Ï†ïÎ≥¥</h3>
                  <div className="transport-routes">
                    {Array.isArray(dayTransport) && dayTransport.map((route, routeIndex) => (
                      <div key={routeIndex} className="transport-route">
                        <div className="route-header">
                          <span className="route-time">{route.time}</span>
                          <span className="route-direction">
                            {route.from} ‚Üí {route.to}
                          </span>
                        </div>
                        {route.transport_info && route.transport_info.recommended_routes && (
                          <div className="route-options">
                            {route.transport_info.recommended_routes.map((option, optionIndex) => (
                              <div key={optionIndex} className="route-option">
                                <div className="option-header">
                                  <span className="option-type">{option.route_type}</span>
                                  {option.route && <span className="option-route">{option.route}</span>}
                                </div>
                                <p className="option-description">{option.description}</p>
                                <div className="option-meta">
                                  <span className="option-time">‚è±Ô∏è {option.estimated_time}</span>
                                  <span className="option-fare">üí∞ {option.fare}</span>
                                </div>
                              </div>
                            ))}
                          </div>
                        )}
                      </div>
                    ))}
                  </div>
                </div>
              );
            })}
          </div>
        </div>
      )}

      {/* Ï†ÑÏ≤¥ Ïó¨Ìñâ Ìò∏ÌÖî Í≤ÄÏÉâ ÎßÅÌÅ¨ */}
      {tripPlan.trip_hotel_search && (
        <div className="trip-hotel-search-card">
          <h2 className="trip-hotel-search-title">üè® Ìò∏ÌÖî Í≤ÄÏÉâ Î∞è ÏòàÏïΩ</h2>
          <div className="trip-hotel-search-info">
            
            <div className="search-links-section">
              <h3 className="search-links-title">Ìò∏ÌÖî ÏòàÏïΩ ÏÇ¨Ïù¥Ìä∏ÏóêÏÑú Í≤ÄÏÉâÌïòÍ∏∞</h3>
              <p className="search-links-description">
                ÏïÑÎûò ÎßÅÌÅ¨Î•º ÌÅ¥Î¶≠ÌïòÎ©¥ ÏûÖÎ†•ÌïòÏã† Ïó¨Ìñâ Ï†ïÎ≥¥Î°ú Í∞Å ÏÇ¨Ïù¥Ìä∏ÏóêÏÑú Ìò∏ÌÖîÏùÑ Í≤ÄÏÉâÌï† Ïàò ÏûàÏäµÎãàÎã§.
              </p>
              <div className="search-links-grid">
                {Object.entries(tripPlan.trip_hotel_search.search_links).map(([siteKey, siteInfo]) => (
                  <a
                    key={siteKey}
                    href={siteInfo.url}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="search-link-card"
                    title={`${siteInfo.name}ÏóêÏÑú ${tripPlan.trip_hotel_search?.destination} Ìò∏ÌÖî Í≤ÄÏÉâÌïòÍ∏∞`}
                  >
                    <div className="search-link-icon">{siteInfo.icon}</div>
                    <div className="search-link-content">
                      <h4 className="search-link-name">{siteInfo.name}</h4>
                      <p className="search-link-description">{siteInfo.description}</p>
                    </div>
                    <ExternalLink className="search-link-arrow" />
                  </a>
                ))}
              </div>
            </div>
          </div>
        </div>
      )}

      

      {/* Ïó¨Ìñâ ÌåÅ */}
      <div className="tips-card">
        <h2 className="tips-title">üí° Ïó¨Ìñâ ÌåÅ</h2>
        <div className="tips-grid">
          {tripPlan.tips.map((tip, index) => (
            <div key={index} className="tip-item">
              <span className="tip-icon">üí°</span>
              <p className="tip-text">{tip}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default TripResult;
